DECLARE @idoc int
EXEC sp_xml_preparedocument @idoc OUTPUT, @X
-- Execute a SELECT statement that uses the OPENXML rowset provider.
SELECT SUM(PL)PL,W/50*50 W
FROM(
SELECT    PL,CONVERT(int,CONVERT(money, dbo.clr_RegEx_Replace(WM,'(FXTC|\|\d+)','',10,0,1)))W
FROM       OPENXML (@idoc, '/Root/closed_trades',0)
WITH (PL numeric(18,2) '@PL', WM varchar(32) '@OQTXT')
)T
GROUP BY W/50*100 WITH ROLLUP
ORDER BY W

